const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    borderRadius: 5,
    boxShadow: "0 10px 30px #BBB",
    padding: 10,
    marginRight:"20px"
  },
  paper: {
    padding: theme.spacing(1),
    display:"flex",
    justifyContent:'center',
    backgroundColor:"#391465"
  },
 other:{
   borderRadius:"24px",
   border:"1px solid #1dbc4 " 
 },
}));


export default function Home() {
  const [openCom,setOpencom] =useState(false);
  const classes = useStyles();


  return (<>
  <div className="home">
    <></>

      <div className="commencer">
        <p>Apprendre en<br></br>s'amusant</p><br></br>
        <button text="commencer" onClick={() => { setOpencom(true);}} style={{marginTop:"17px"}}></button>
        </div>
      </div>    
        <Commencer title="Qui es-tu ?" className={classes.titre} setOpencom={openCom} setOpencom={setOpencom}>
            <div className={classes.root} direction="row">

                <Grid item className={classes.other}sm={6} xs={6}>
                    <div >

                    </div>

                </Grid>
                <Grid item sm={6} xs={6}>
                    <div><h2>Enfant</h2></div>
                </Grid>
            </div>
        </Commencer>
      </>

  );
}
